INSERT INTO `r_patient_medical_history` VALUES (7,383,25,'主诉：数年来频频对生活工作中的各种事焦虑紧张，近一月由于工作学习原因紧张焦虑加剧，伴口干，偶尔失眠。\r\n现病史：数年来总是担忧生活和学习中即将发生的事，害怕出错，处理不好患者担忧的是不固定，只要是未来即将发生的，可能会出现变动的意外的事，都会引起焦虑，严重时伴有胸闷口干尿频失眠。近一月，由于学习科研压力，担任科研小组长，每天要安排实验流程，故而紧张，焦虑加重，一发脾气烦躁，紧张易疲乏。以致影响到正常的工作和生活，睡眠食欲500无改变二便，可体重无变化。\r\n过敏史：无\r\n家族史：无',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,'2020-12-17 22:48:34','2020-12-17 22:48:34'),(8,399,25,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,'2020-12-18 01:35:45','2020-12-18 01:35:45'),(9,397,25,'2019年11,12月份，开始感到情绪低落，不想做事，当时参与学校的一个大伙动，不顺利，遇到很多困难。此后，感到情绪低落，喜爱嗯哭，什么事也不想，疫情期间，加推免这段时间，感到抑郁不开心。\r\n8月份左右，推免成功，但社团活动仍要进行，感到烦躁，还有统计返校，感到没有动力，抑郁状态减轻。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,4,'2020-12-18 22:11:00','2020-12-18 22:11:00'),(10,417,25,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'2020-12-18 23:43:24','2020-12-18 23:43:24'),(11,420,25,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,NULL,NULL,6,'2020-12-19 00:14:03','2020-12-19 00:32:48'),(13,424,25,'现病史：患者自诉刚入院时心情烦躁，无法集中注意力，无法参与正常的学习生活。药物+rTMS治疗。自觉烦躁减轻，睡眠食欲可。可以集中注意力做一些事情比如下乡其，rTMS治疗无诉头皮或其他部位的疼痛，治疗时多次睡着。\r\n初步诊断：双相情感障碍，部分缓解',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,'2020-12-19 00:50:07','2020-12-19 00:50:07'),(14,425,25,'主诉：有过三次自杀行为\r\n现病史：产后出现食欲不振精力不足注意力不集中。\r\n既往史，初高中阶段因校园，暴力家庭等原因出现心境低落食欲不振体重明显减少，觉得自己没有价值，对学习失去兴趣，精力减退，有过三次自杀行为，均未遂（割腕），严重影响生活及社会功能。\r\n家族史：姨妈有精神疾病，诊断不详\r\n初步诊断：重性抑郁障碍\r\n治疗：未用药',NULL,NULL,'2005-06-01','2011-06-01','无',1,NULL,NULL,0,0,1,NULL,NULL,1,'2020-12-19 00:51:54','2020-12-19 00:51:54'),(15,431,25,'rTMS治疗效果自评：\r\n患者报告每次rTMS治疗时无任何感受，无诉头皮疼痛或其他不适，治疗后无任何感受。整个rTMS治疗无任何感受，整个rTMS治疗后抑郁情绪大有改善，失眠症状消失，易激惹症状大有改善。自诉对未来已有新的规划，充满期待，也不再萌生自山意念。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,'2020-12-19 00:59:39','2020-12-19 00:59:39'),(16,437,25,'rTMS效果自我报告：\r\n自我没什么感觉，整个rTMS+要去治疗后病人报告心情没那么低沉消极了，但还死还是不想去上学，对学习没什么兴趣，但愿意去看一些自己喜欢的书,小说。rTMS治疗时无头痛头晕及其他不适。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,'2020-12-19 01:15:48','2020-12-19 01:15:48'),(17,454,25,NULL,'2020-06-01','2020-09-01','2020-09-01','2020-11-20','BD',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,5,'2020-12-19 14:04:12','2020-12-19 14:04:12'),(18,453,25,'过敏史：青霉素过敏','2020-05-01','2020-05-31','2020-05-31','2020-12-04','MDD',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,5,'2020-12-19 14:19:25','2020-12-19 14:19:25'),(19,452,25,NULL,'2020-08-01','2020-08-31','2020-10-01','2020-12-02','BD',NULL,NULL,NULL,0,0,1,NULL,NULL,5,'2020-12-19 14:24:22','2020-12-19 14:24:22'),(20,455,25,NULL,'2017-02-01','2017-03-01','2017-03-01','2020-11-29','BD',NULL,NULL,NULL,1,NULL,1,NULL,NULL,5,'2020-12-19 14:50:32','2020-12-19 16:04:05'),(22,456,25,NULL,'2020-10-01','2020-11-01','2020-11-01','2020-11-24','SZ',NULL,NULL,NULL,0,NULL,1,NULL,NULL,5,'2020-12-19 16:46:44','2020-12-19 16:46:44'),(23,459,25,NULL,'2017-04-01','2017-05-01','2017-05-01','2017-06-01','MDD',2,'2020-09-01',NULL,0,0,1,NULL,NULL,5,'2020-12-19 17:14:04','2020-12-19 17:14:04'),(24,460,25,NULL,'2020-09-01','2020-10-01','2020-10-01','2020-12-06','BD',NULL,NULL,NULL,0,0,1,NULL,NULL,5,'2020-12-19 17:53:34','2020-12-19 17:53:34'),(25,465,25,NULL,'2017-01-01','2017-12-31','2019-04-01','2020-12-07','BD',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,5,'2020-12-21 08:49:09','2020-12-21 08:49:09'),(26,466,25,'主诉：反复重复动作半年\r\n现病史：患儿自近半年前逐渐出现反复重复动作，一句话重复多遍。反复担心、紧张。病程中患儿无高热、抽搐、颅脑外伤史，饮食较好，睡眠一般，大小便外观未见明显异常。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,'2020-12-21 09:55:53','2020-12-21 09:55:53'),(27,467,25,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,5,'2020-12-21 10:11:06','2020-12-21 10:11:06'),(28,470,25,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,5,'2020-12-21 10:52:45','2020-12-21 10:52:45'),(29,474,25,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,'2020-12-21 10:59:32','2020-12-21 10:59:32'),(30,481,25,NULL,NULL,NULL,NULL,NULL,'SZ（偏执型）',NULL,NULL,NULL,1,NULL,1,NULL,NULL,5,'2020-12-21 14:33:38','2020-12-21 14:33:38'),(34,482,25,'现病史：\r\n生产后20余填出现情绪低落，易哭。入睡困难，半夜醒，注意力，记忆力严重下降。于2020年9月于我院门诊就诊，拟“产后抑郁。由于哺乳未用药，寻求非药物治疗。\r\n既往史：甲状腺癌术后长期服用甲状腺素片。\r\n初步诊断：ADD','2020-07-01','2020-09-01','2020-09-01','2020-12-01','产后抑郁',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,5,'2020-12-21 14:37:40','2020-12-21 14:37:40'),(39,486,25,NULL,'2019-10-01','2020-01-01','2020-01-01','2020-12-01','MDD',NULL,NULL,NULL,1,NULL,1,NULL,NULL,5,'2020-12-21 15:08:18','2020-12-21 15:08:18'),(42,484,25,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,NULL,NULL,5,'2020-12-21 15:24:49','2020-12-21 15:24:49'),(46,489,25,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,'2020-12-21 15:29:26','2020-12-21 15:29:26'),(51,490,25,NULL,'2019-12-01','2020-01-01','2020-01-01','2020-12-01','MDD',NULL,NULL,NULL,1,NULL,1,NULL,NULL,5,'2020-12-21 15:45:08','2020-12-21 15:45:08'),(53,492,25,NULL,'2017-01-01','2019-06-01','2019-06-01','2020-12-01','BD',NULL,NULL,NULL,1,NULL,1,NULL,NULL,5,'2020-12-21 16:18:08','2020-12-21 16:18:08'),(57,495,25,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,6,'2020-12-21 17:21:25','2020-12-21 17:21:25'),(58,493,25,'主诉:反复询问半年\r\n现病史:近半年来反复询问，特别在吃完晚饭后，- 直对家人询问，有时问一些无需问的问题，影响学习，家人不回答就自言自语，焦虑不安，明知不需要问，仍控制不住的问。烦躁扔东西。夜眠不好。有很多担心。\r\n既往史:无特殊\r\n个人史:无特殊\r\n家族史:无特殊\r\n查体:神清心肺未见异常，神经系统未见异常\r\n精神检查:神清，问答切题，情感适切，未引出幻觉、妄想\r\n门诊诊断:强迫状态',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,'2020-12-21 17:40:59','2020-12-21 17:40:59'),(59,508,25,'现病史：2019年5月不爱说话，长时间低落，持续几天。2020年5月份，情绪低落，和去年很像，程度不及持续一周左右。七月末集训感到异常自信，非常很快乐，比较活跃，即使分数不高，也很快乐，持续三周多。\r\n治疗：碳酸锂，早晨1粒，晚1粒。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'2020-12-21 20:42:12','2020-12-21 20:42:12'),(60,511,25,'高二下学期，因为实验班没进去，受到打击，再加上与朋友交际关系紧张，父母生病；感到不幸，为一点小事就崩溃。\r\n高三上学期，情绪低落明显，丧失兴趣，想哭泣约1周左右。\r\n今年5月份，与室友聊天，感到融入不进去，感到难过，悲伤。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'2020-12-21 21:18:22','2020-12-21 21:18:22'),(61,514,25,'现病史：初二考试特别差，感到学习很焦虑，此后一直到现在，感到很焦虑。中考前两三个月，情绪低落，哭泣，暴饮暴食，睡眠不好。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'2020-12-21 21:55:28','2020-12-21 21:55:28'),(62,524,25,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,10,'2020-12-22 19:26:12','2020-12-22 19:26:12'),(64,528,25,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,4,'2020-12-22 20:10:37','2020-12-22 20:10:37'),(65,529,25,'现病史：\r\n2018年出现情绪不好\r\n2020.4又出现情绪不好，自杀行为\r\n2020.9平稳\r\n2020.10情绪又低落\r\n2020.11来门诊','2018-01-01',NULL,'2020-04-01',NULL,'MDD',NULL,'2020-04-01','抑郁状态',1,NULL,NULL,NULL,NULL,11,'2020-12-22 20:23:17','2020-12-22 20:23:17'),(67,534,25,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2020-09-01',NULL,NULL,NULL,NULL,NULL,NULL,9,'2020-12-23 09:17:16','2020-12-23 09:17:16'),(69,535,25,'r-TMS治疗反馈\r\n治疗感受：烦躁少了很多，情绪变好了。治疗时候，偶有疼痛，可以忍受。做完偶尔会略有头晕，几分钟后消失。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'2020-12-23 10:28:47','2020-12-23 10:28:47'),(70,538,25,NULL,'2015-01-01','2017-01-01','2020-01-01','2020-10-01','MDD',NULL,'2020-01-01','MDD',0,0,1,NULL,NULL,9,'2020-12-23 10:35:26','2020-12-23 10:35:26'),(71,540,25,'r-TMS治疗时有头晕，无其他特殊感受，r-TMS+药物治疗后抑郁情绪大大改善，无烦躁不安，不再易发脾气，目前不再有自残想法，食欲睡眠可。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,'2020-12-23 10:38:51','2020-12-23 10:38:51'),(72,542,25,'r-TMS治疗反馈\r\n治疗感受：r-TMS治疗无诉头痛，每次做完后稍有头晕，无其他特殊感受。整个rTMS+药物治疗后烦躁次数减少，每次烦躁也不至于伤害自己，会大叫。情绪低落的时间变少，精神病症状消失，睡眠食欲尚可',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,'2020-12-23 10:49:09','2020-12-23 10:49:09'),(73,543,25,'rTMS治疗反馈\r\n治疗感受：无明显不适，刚做完会头晕，无明显感觉',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'2020-12-23 10:57:33','2020-12-23 10:57:33'),(74,544,25,'rTMS治疗反馈\r\n治疗次数：10\r\n治疗感受：rTMS治疗无诉头痛或头晕，自诉几乎每次都睡着，无特殊感受。整个rTMS+药物治疗后烦躁，情绪大大改善。能集中注意力学习，近一周易想起与同学老师的矛盾，觉得愤怒悲伤。情绪低落，入睡困难。躺在床上4小时才能入睡，多恶梦，食欲可',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,'2020-12-23 11:12:45','